import React from 'react';
import { Switch, HashRouter as Router } from 'react-router-dom';

import Icecek from './pages/icecek';
import Tatli from './pages/tatli';
import Yemek from './pages/yemek';
import Home from './pages/anasayfa';
import support from './pages/support';

const Main = () => {
  return (
    <Router> {/* The Switch decides which component to show based on the current URL.*/}
    <div>
      <Router exact path='/' component={Home}></Router>
      <Router exact path='/yemek' component={Yemek}></Router>
      <Router exact path='/tatli' component={Tatli}></Router>
      <Router exact path='/icecek' component={Icecek}></Router>
      <Router exact path='/support' component={support}></Router>
      </div>
    </Router>
  );
}

export default Main;
